import logonavbar from "../../imagens/logo-navbar.png";
import iconeusuario from "../../imagens/icone_usuario.png";
import "./Navbar.css";
import { Link } from 'react-router-dom';


function navbar() {
  return (
    <>

          <noscript>You need to enable JavaScript to run this app.</noscript>
          <div id="root"></div>

          <nav className="navbar navbar-expand-sm" style={{ height: '65px', margin:'22px 0 0 0', backgroundColor:'white' }}>

            <div className="container">

              {/*logo*/}
              <a className="navbar-brand" href="#">
              <img src= {logonavbar} alt="Logo" style={{ height: '65px' }}/>
              </a>
              {/*logo*/}

                <div style={{ padding: '0 15px 0 15px' }}>
                <Link id="azul1" className="navbar-brand " to='/' style={{ fontWeight: 'bold', padding: '0 15px 0 15px'}}>Home</Link>

                <Link id="azul1" className="navbar-brand" to='/Etes' style={{ fontWeight: 'bold' , padding: '0 15px 0 15px'}}>ETE´S</Link>

                <Link id="azul1" className="navbar-brand" to='/Sobre' style={{ fontWeight: 'bold' , padding: '0 15px 0 15px'}} >Diretório</Link>

                <Link id="azul1" className="navbar-brand" to='/Sobre' style={{ fontWeight: 'bold', padding: '0 15px 0 15px' }} >Entre em contato</Link>
                </div>


                <div className="container" id="icone-login" style={{textAlign:'center', color:'#0a3dbf'}}>


                <a className="navbar-brand" style={{margin: '0 auto'}} href="#">
                <img className=" " src= {iconeusuario} alt="Logo" style={{ height: '35px'}}/>
                </a>

                {/*
                <i className="bi bi-person-circle" style={{ fontSize: '30px' }}></i>
                */}

                <a className="nav-link" id="link-login"  href="#"> Login</a>
                </div>

            </div>

          </nav>

    </>
  )
}

export default navbar;
